(()=>{return(n,e)=>{const a=[{name:"常规"},{name:"宽屏"},{name:"网页全屏"},{name:"全屏"}];SpinQuery.any(()=>$(".gui-settings-dropdown:has(input[key=defaultPlayerMode])"),n=>{const e=n.find("ul");const i=n.find("input");Object.values(a).forEach(n=>{$(`<li>${n.name}</li>`).prependTo(e).on("click",()=>{i.val(n.name).trigger("input").change()})})})}})();